import Link from 'next/link'

const about = () => (
    <div>
        <ul>
            <li><Link href="/"><a>About</a></Link></li>
        </ul>
        <h2>About BitzPrice</h2>
        <p>Application to view bitcoin prices</p>
    </div>
);

export default about;
